(function(){Template.__checkName("cover_letter"),Template.cover_letter=new Template("Template.cover_letter",function(){var e=this;return[HTML.STYLE("\n        body {\n            background-color: #fff;\n        }\n    "),"\n    ",HTML.DIV({id:"wrap cover-letter-landing"},"\n        ",Spacebars.include(e.lookupTemplate("nav")),"\n        ",HTML.Raw('<div class="row coverletter_banner">\n            <div class="coverletter_banner_wrapper">\n                <img class="courier_boy" src="/images/cover_letter_landing/courier.png" alt="Deliver your resume image">\n                <div class="header1 text-white">\n                    Build your perfect cover letter and resume with\n                </div>\n                <img class="cover-letter-logo" src="/images/resume_logo_all_white.png" alt="Resume.com logo">\n                <button class="btn btn-xl btn-blue ladda-button coverletter_start_submit" data-style="expand-right">Start Now</button>\n            </div>\n        </div>'),"\n        ",HTML.DIV({"class":"cover-letter-promo container-fluid"},"\n            ",HTML.DIV({"class":"coverletter_info"},"\n                ",HTML.Raw('<!--\n                <div class="cl-section1">\n                    <div class="main_section container">\n                        <div class="col-sm-12">\n                            <p class="cl-header">Don\'t break employers\' hearts!</p>\n                            <p>Send them cover letters for Valentine’s Day by accessing Resume.com’s easy cover letter and resume builder for <strong>free for 24 hours</strong> on February 14.</p>\n                            <p>Cover letters are like love letters from job seekers to employers. They’re the best way you can get noticed by employers’ so you can start a relationship with them as their newest employee. </p>\n                            <p>Cover letters tell employers who you are as an individual, show off your skills, and share why you’re the right candidate to join their team. Your job applications aren’t complete without them. </p>\n                            <p>Get the attention you need to get hired fast. Create your perfect cover letter and resume builder for free with 24 hours of premium access - but hurry, this limited time offer ends on February 14!</p>\n                        </div>\n                        <div class="col-sm-12">\n                            {{> cover_letter_cta2}}\n                        </div>\n                    </div>\n                </div>\n-->'),"\n                ",HTML.Raw('<div class="text-center boxed-blue">\n                    <div class="main_section container">\n                        <h1 class="header1 text-white">The Ultimate Guide to Cover Letters</h1>\n                        <p>Today’s job market is fierce. Now that employers are getting hundreds of applications for a single job posting, the reality is that you absolutely need a cover letter to get noticed. </p>\n                        <p>Taking the time to create a unique cover letter shows employers that you really care about the job you’re applying for. </p>\n                        <p>Cover letters also show employers why you, as an individual, are worth hiring. They’re one of the best opportunities you have to show off your personality, skills, and accomplishments in a compelling way. </p>\n                        <p>Resumes are invaluable, but cover letters really make you stand out. </p>\n                        <p>Check out this ultimate guide on how to write a cover letter that will get you hired fast. </p>\n                    </div>\n                </div>'),"\n                ",HTML.Raw('<div class="cl-brainstorm cl-background-img"></div>'),"\n                ",HTML.DIV({"class":"container"},"\n                    ",HTML.DIV({"class":"main_section"},"\n                        ",HTML.Raw('<p class="header1">What\'s a Cover Letter?</p>'),"\n                        ",HTML.Raw("<p>Cover letters tell your story. Their purpose is to introduce you to employers as a potential candidate for the job opening you’re applying for. </p>"),"\n                        ",HTML.Raw("<p>On a fundamental level, cover letters actually explain to employers why they should hire you. These letters bridge the gap between your resume - a list of skills, qualifications, and employment history - and an interview. </p>"),"\n                        ",HTML.Raw("<p>They allow you to elaborate on your resume, as well. That makes cover letters invaluable for candidates who may not fit the exact requirements of a job, such as new grads, students, and people who are changing career paths. </p>"),"\n                        ",Spacebars.include(e.lookupTemplate("cover_letter_cta3")),"\n                    "),"\n                "),"\n                ",HTML.Raw('<div class="cl-section4">\n                    <div class="main_section container">\n                        <p class="header1">What Should I Write in My Cover Letter?</p>\n                        <p>The most important thing to keep in mind when you’re writing a cover letter is that it should answer the employer’s fundamental question, “Why should I hire you?”\n                        </p>\n                        <p>Your cover letter should be several paragraphs long, but no larger than one page in length.\n                        </p>\n                        <p>The introductory paragraph explains why you are writing to the employer, as well as how you heard about the job opening.</p>\n                        <p>The main body of text can be between one to three paragraphs. This text elaborates on the most relevant skills and experiences in your resume that would make you the best fit for the specific job opening you’re applying for.</p>\n                        <p>For the main body of text, write about the most important qualifications that make you a standout candidate for the position. Frame this text to explain how you’d add to the employer’s company in a positive way.</p>\n                        <p>In the final paragraph, thank the employer for considering your application, restate your interest in the position, and state your availability for an interview. </p>\n                    </div>\n                </div>'),"\n                ",HTML.Raw('<div class="cl-man-interview cl-background-img"></div>'),"\n                ",HTML.DIV({"class":"container"},"\n                    ",HTML.DIV({"class":"main_section"},"\n                        ",HTML.Raw('<div class="header1">5 Fast Tips to Write a Cover Letter</div>'),"\n                        ",HTML.Raw('<div class="header2">1. Address the Employer or Recruiter by Name</div>'),"\n                        ",HTML.Raw("<p>Don’t address your cover letter to a “Sir”, “Ma’am,” or “To Whom It May Concern.” In fact, many hiring managers won’t read a cover letter if they aren’t addressed by name!</p>"),"\n                        ",HTML.Raw("<p>Your employer will be impressed that you took the time to find out the right person to address your cover letter to.</p>"),"\n                        ",HTML.Raw("<p>All that’s required is a little research on LinkedIn to check out who the hiring manager or human resources manager is for the company you’re applying for. </p>"),"\n                        ",HTML.Raw("<p>If you’re in doubt, simply give the employer a call to ask for the right name. The employer won’t mind, and they may even be impressed that you took the extra step to get their name right.</p>"),"\n\n                        ",HTML.Raw('<div class="header2">2. Tailor Your Cover Letter to the Job</div>'),"\n                        ",HTML.Raw("<p>Do a little research to match your cover letter to the employer’s brand voice. Employers hire for corporate culture. They want new hires to fit in right away, so you should aim to write like you’re already a part of their team.</p>"),"\n                        ",HTML.Raw("<p>For example, if the employer’s brand voice is extremely formal, write very professionally. On the other hand, if they have a hyper-modern tone of voice, you can write more informally. </p>"),"\n                        ",HTML.Raw('<p>For tips on how to customize your cover letter for a specific employer, check out this article on, <a href="https://www.resume.com/careers/resume-writing/tailor-resume-summary-cover-letter-job/">“How to Tailor Your Resume, Summary, and Cover Letter to Any Job”</a> </p>'),"\n                        ",Spacebars.include(e.lookupTemplate("cover_letter_cta3")),"\n                    "),"\n                    ",HTML.Raw('<div class="main_section row" style="padding-top:0;">\n                        <div class="col-md-6">\n                            <img src="/images/cover_letter_landing/cl_icons.png" class="cl-icons" alt="resume icons">\n                        </div>\n                        <div class="col-md-6">\n                            <div class="header2">3. Provide Anecdotes and Evidence</div>\n                            <p>It’s important to follow up statements about yourself with real life examples or anecdotes. Providing evidence of your accomplishments is a quick and easy way to get an employer to pay attention to you as an outstanding candidate.</p>\n                            <p>For example, employers often value leadership in candidates. Instead of writing that you have leadership skills, which employers read all the time, talk about how you organized a school rally or directed a fundraising campaign.</p>\n                        \n                            <div class="header2">4. Type Your Cover Letter Out</div>\n                            <p>Your cover letter will look much more polished if it’s typed and printed out from a word processor on a computer. If you don’t have access to a computer, your local library or school should have computers available for your use. </p>\n                        \n                            <div class="header2">5. Proofread, Proofread, Proofread!</div>\n                            <p>Before you send your cover letter off to the employer, make sure you proofread it. Check your grammar and punctuation carefully.</p>\n                            <p>After you’re finished proofreading your cover letter, ask a friend or family member to do an additional review for grammar and punctuation.</p>\n                        </div>                       \n                    </div>'),"\n                "),"\n                ",HTML.Raw('<div class="cl-resume-review cl-background-img"></div>'),"\n                ",HTML.DIV({"class":"container"},"\n                    ",HTML.DIV({"class":"main_section"},"\n                        ",HTML.Raw('<p class="header1">Do Employers Actually Read Cover Letters?</p>'),"\n                        ",HTML.Raw("<p>Wait, hold on a hot second. There’s a rumor going around that you don’t need a cover letter at all. Why should you go to the to trouble of writing one if you don’t need it to get a job?</p>"),"\n                        ",HTML.Raw("<p>To be honest, the reality is that you don’t know whether an employer cares about your cover letter - so why take a chance that they’ll miss it?</p>"),"\n                        ",HTML.Raw("<p>It’s always best to write a short cover letter, no matter what. </p>"),"\n                        ",HTML.Raw("<p>Don’t be intimidated by writing a cover letter. With the cover letter builder, writing a cover letter is a breeze. Try out the cover letter and resume builder here.</p>"),"\n                        ",Spacebars.include(e.lookupTemplate("cover_letter_cta3")),"\n                    "),"\n                "),"\n                ",HTML.Raw('<div class="cl-section7 main_section text-center boxed-blue">\n                    <div class="container">\n                            <p class="header1">Cover Letter Samples</p>\n                            <p>Check out these cover letter examples for ideas on how to start your perfect cover letter!</p>\n                            <div class="row">\n                                <div class="col-sm-4">\n                                <a href="/coverletter/coverletter-sales-representative-sample" target="_blank"><img src="/images/cover_letter_landing/cl-sample1.png" alt="Cover letter example #1 - Sales Representative">\n                                    <p>Cover letter example #1 - Sales Representative</p>\n                                </a>\n                            </div>\n                            <div class="col-sm-4">\n                                <a href="/coverletter/coverletter-cashier-sample" target="_blank"><img src="/images/cover_letter_landing/cl-sample2.png" alt="Cover letter example #2 - Cashier">\n                                    <p>Cover letter example #2 - Cashier</p>\n                                </a>\n                            </div>\n                            <div class="col-sm-4">\n                                <a href="/coverletter/coverletter-administrative-assistant-sample" target="_blank"><img src="/images/cover_letter_landing/cl-sample3.png" alt="Cover letter example #3 - Administrative Assistant">\n                                    <p>Cover letter example #3 - Administrative Assistant</p>\n                                </a>\n                            </div>    \n                        </div>\n                    </div>\n                </div>'),"\n                ",HTML.DIV({"class":"cl-section8"},"\n                    ",HTML.DIV({"class":"main_section container article-links"},"\n                        ",HTML.Raw('<p class="header2">Learn More</p>'),"\n                        ",HTML.Raw('<p class="bold">Want to know more? Check out these essential Careers Center articles on cover letters now!</p>'),"\n                        ",HTML.Raw('<div class="row">\n                            <div class="col-sm-6">\n                                <a href="//www.resume.com/careers/resume-writing/tailor-resume-summary-cover-letter-job/" target="_blank">\n                                    <img src="//www.resume.com/careers/wp-content/uploads/2017/01/7ES0X4Z8UI.jpg" alt="How to Tailor Your Resume, Summary, and Cover Letter to Any Job">\n                                    <div>How to Tailor Your Resume, Summary, and Cover Letter to Any Job</div>\n                                </a>\n                            </div>\n                            <div class="col-sm-6">\n                                <a href="//www.resume.com/careers/cover-letters/3-ways-personalize-cover-letter-template" target="_blank">\n                                    <img src="//www.resume.com/careers/wp-content/uploads/2017/02/GIK662HVHL.jpg" alt="3 Ways to Personalize Your Cover-letter Template">\n                                    <div>3 Ways to Personalize Your Cover-letter Template</div>\n                                </a>\n                            </div>\n                        </div>'),"\n                        ",HTML.Raw('<div class="row">\n                            <div class="col-sm-6">\n                                <a href="//www.resume.com/careers/resume-writing/tailor-resume-summary-cover-letter-job/" target="_blank">\n                                    <img src="//www.resume.com/careers/wp-content/uploads/2017/02/RO991LF7HO.jpg" alt="How to Tailor Your Resume, Summary, and Cover Letter to Any Job">\n                                    <div>3 Cover Letter Opening Sentences to Start Your Cover Letter</div>\n                                </a>\n                            </div>\n                            <div class="col-sm-6">\n                                <a href="//www.resume.com/careers/cover-letters/3-ways-personalize-cover-letter-template" target="_blank">\n                                    <img src="//www.resume.com/careers/wp-content/uploads/2017/02/cover-letter-mistakes-2.jpg" alt="3 Ways to Personalize Your Cover-letter Template">\n                                    <div>5 Common Cover Letter Mistakes You’re Probably Making Right Now</div>\n                                </a>\n                            </div>\n                        </div>'),"\n                        ",HTML.Raw('<p class="header1 cl-last-cta section-thin-padding">Ready... Set... Start!</p>'),"\n                        ",Spacebars.include(e.lookupTemplate("cover_letter_cta3")),"\n                    "),"\n                "),"\n            "),"\n        "),"\n        ",Blaze.If(function(){return Spacebars.call(e.lookup("currentUser"))},function(){return["\n            ",Blaze._TemplateWith(function(){return{template:Spacebars.call(e.lookup("premium_popup_version"))}},function(){return Spacebars.include(function(){return Spacebars.call(Template.__dynamic)})}),"\n        "]},function(){return["\n            ",Spacebars.include(e.lookupTemplate("loginform"))," \n            ",Spacebars.include(e.lookupTemplate("forgotform")),"\n        "]}),"\n    "),"\n    ",Spacebars.include(e.lookupTemplate("footerLarge"))]})}).call(this);

(function(){Template.__checkName("cover_letter_sample1"),Template.cover_letter_sample1=new Template("Template.cover_letter_sample1",function(){var e=this;return[Spacebars.include(e.lookupTemplate("nav")),HTML.Raw('\n    <h1 class="text-center">Sales Representative Cover Letter Sample</h1>\n    <ul id="coverletter_holder_sample">\n        <li class="resume_slide slide_wiz3 coverletter_sample1">\n            <div class="col-sm-3 text-center">\n                <p>\n                    <div class="header1 text_color">Darrell\n                        <br>Warren\n                    </div>\n\n                    <div class="header2 text_color">Contact</div>\n                    <div style="font-weight:bold;">\n                        123 Apple Road\n                        <br> New York, NY 10001\n                        <br> 123-456-7891\n                        <br> darrellwarren@email.com\n                    </div>\n                </p>\n            </div>\n            <div class="col-sm-9">\n                <div class="row border-top">\n                    <div class="col-sm-6">\n                        <div style="font-weight:bold;">\n                            Karen Wilfred\n                            <br> Sales Manager\n                            <br> Shoes Inc.\n                            <br> 456 Gala Street\n                            <br> New York, NY 10002\n                        </div>\n                    </div>\n                    <div class="col-sm-6 text-right">\n                        <div style="font-weight:bold;">February 1, 2017</div>\n                    </div>\n                    <div class="col-sm-12">\n                        <br>\n                        <p>Dear Karen,</p>\n                        <p>I am writing to apply for your Senior Sales Representative position at Shoes Inc. currently advertised on <a href="https://www.resume.com">Resume.com</a>. Please find a copy of my resume attached for your consideration.</p>\n                        <p>I believe that the skills and experience I have gained as a Sales Representative at Sneakers Inc. for the last five years would make me an ideal fit for your company.</p>\n                        <p>Working in the retail industry for half a decade has allowed me to develop a wide array of sales and customer service skills that would be an asset to Shoes Inc. </p>\n                        <p>I am a persuasive, supportive salesperson with strong leadership qualities and an excellent track record for commission performance. For example, I have successfully exceeded my sales targets for each season by at least 20 percent since 2014 and lead the floor team to surpass our quarterly quota by over $5,000 last month.</p>\n                        <p>I would love to opportunity to bring similar accomplishments to Shoes Inc. Please feel free to reach out to me if you have any questions or if you would like to discuss my application further.</p>\n                        <p>I am available for an interview at your convenience. Thank you for your consideration.</p>\n                        <p>I look forward to hearing from you soon.</p>\n                        <p style="font-weight:bold;">Sincerely,</p>\n                        <div class="text-right">\n                            <div class="header3 text_color script_font">Darrell Warren</div>\n                            <div style="font-weight:bold;">\n                            Darrell Warren\n                            <br> 123-456-7891\n                            <br> darrellwarren@email.com\n                            </div>\n                        </div>\n                    </div>\n                </div>\n\n\n            </div>\n        </li>\n    </ul>\n    <div class="resume_logo_floater">\n        <img src="/images/resume_logo_pb.png" alt="Powered by: Resume.com">\n    </div>\n    '),Spacebars.include(e.lookupTemplate("footerLarge"))]})}).call(this);

(function(){Template.__checkName("cover_letter_sample2"),Template.cover_letter_sample2=new Template("Template.cover_letter_sample2",function(){var e=this;return[Spacebars.include(e.lookupTemplate("nav")),HTML.Raw('\n    <h1 class="text-center">Cashier Cover Letter Sample</h1>\n    <ul id="coverletter_holder_sample">\n        <li class="resume_slide slide_wiz3 coverletter_sample2">\n            <div class="col-xs-12 text-center">\n                <div class="header1 text_color">Anne Davis</div>\n                <div class="header2 text_color">Cashier</div>\n                <div class="border_bottom"></div>\n            </div>\n            <div class="col-xs-3 text-center">\n                <div class="header2 text_color">Contact</div>\n                    <div style="font-weight:bold;">\n                    123 Apple Road\n                    <br> New York, NY 10001\n                    <br>\n                    <br>Anne Davis\n                    <br> 101-101-1001\n                    <br> annedavis@email.com\n                </div>\n            </div>\n            <div class="col-xs-9">\n                <div class="border_left">\n                    <div class="header2 text_color">Hi Martha,</div>\n                    <p>I’m writing with great enthusiasm to apply for your position of Cashier at AMP Organic Foods. When I saw that your company was hiring on Resume.com, I knew that my passion for healthy living, education, and volunteer work experience would make me an ideal fit for the role.</p>\n                    <p>As a part-time health and nutrition student from the University of Riverview, I am a firm believer in the importance of the organic food movement that your company supports in its business model and charitable work with the food bank.</p>\n                    <p>In the last three years, I have fully immersed myself in the organic food movement in my university studies and in my extracurricular activities, which has provided me with a wide range of skills and experience that would make me a great addition to AMP Organic Foods.</p>\n                    <p>I have excellent communication and leadership abilities that I have developed as the Vice President of University of Riverview’s Vegetarian Club. For the last year, I have overseen our club’s monthly meetings, managed our annual animal rights fundraiser, and collaborated with the President, Secretary, and Treasurer to ensure a smooth handover to next year’s executive members.</p>\n                    <p>Additionally, I have volunteered as a Senior Cashier at the Springfield Downtown Library Book Sale for the last four years. This work experience has given me an excellent knowledge of the POS system and has made me adaptable, quick to problem solve, and cool under pressure (despite the book sale’s infamous line-ups every year).</p>\n                    <p>I’m so excited about this opportunity at AMP Organic Foods. Please let me know if you have any questions about my qualifications or experience.</p>\n                    <p>Thank you for your consideration. I am available for an interview at your earliest convenience.</p>\n                    <p class="text_color script_font">Sincerely,</p>\n                </div>\n                <div class="text-right">\n                    <div class="text_color script_font">Anne Davis</div>\n                    <div style="font-weight:bold;">\n                        Anne Davis\n                        <br> 101-101-1001\n                        <br> annedavis@email.com\n                    </div>\n                </div>\n            </div>\n        </li>\n    </ul>\n    <div class="resume_logo_floater">\n        <img src="/images/resume_logo_pb.png" alt="Powered by: Resume.com">\n    </div>\n    '),Spacebars.include(e.lookupTemplate("footerLarge"))]})}).call(this);

(function(){Template.__checkName("cover_letter_sample3"),Template.cover_letter_sample3=new Template("Template.cover_letter_sample3",function(){var e=this;return[Spacebars.include(e.lookupTemplate("nav")),HTML.Raw('\n    <h1 class="text-center">Administrative Assistant Cover Letter Sample</h1>\n    <ul id="coverletter_holder_sample">\n        <li class="resume_slide slide_wiz3 coverletter_sample3">\n            <div class="col-xs-3 text-center">\n                <div class="header3 text_color" style="font-weight:bold;">\n                    <img src="/images/profiletype/avatar_1.png" class="img-circle">\n                    Rick Rogers\n                    <br>888-888-8888\n                    <br>rickrogers@email.com\n                </div>\n            </div>\n            <div class="col-xs-9 text-right">\n                <div class="header1 text_color">Rick Rogers</div>\n                <div class="header2">Administrative Assistant</div>\n            </div>\n            <div class="col-xs-12" style="margin-top:50px">\n                <p>Hi Dave,</p>\n                <p>When I was young, all I wanted to do was design clothing for my Barbie dolls. Luckily, my career options have opened up a little, but I still live, breathe, and eat fashion, design, and the latest trends - all attributes that would make me an ideal fit for Fashion Media Inc.’s hyper fashionable culture as the Administrative Assistant.</p>\n                <p>I am confident that two years as an Administrator and Personal Assistant at XYZ Magazine combined with my degree in fashion design from Carte Blanche University would lead me to excel as an Administrative Assistant at your headquarters in Springfield.</p>\n                <p>My strong problem solving skills, organizational abilities, and self-driven mindset make me someone who you can trust to finish tasks, no matter what. For example, I was responsible for managing Carte Blanche University’s S/S runway collection for the last four years as the Runway Co-Director.</p>\n                <p>Additionally, I’m a huge fan of Fashion Media Inc. I’ve eagerly followed Fashion Media Inc.’s journey to success from its start in the founder’s basement five years ago to being featured in Dress Magazine’s “Top 10 Designer Companies to Watch” list last month.</p>\n                <p>Please don’t hesitate to reach out to me if you have any questions about my qualifications or experience. I am available for an interview at your earliest convenience.</p>\n                <p>Thank you for your consideration. Have a nice day!</p>\n                <p style="font-weight:bold;">Sincerely,</p>\n                <div class="text-right" style="font-weight:bold;">\n                    <div class="header3 text_color script_font">Rick Rogers</div>\n                    Rick Rogers\n                    <br>888-888-8888\n                    <br>rickrogers@email.com\n                </div>\n            </div>\n        </li>\n    </ul>\n    <div class="resume_logo_floater">\n        <img src="/images/resume_logo_pb.png" alt="Powered by: Resume.com">\n    </div>\n    '),Spacebars.include(e.lookupTemplate("footerLarge"))]})}).call(this);

