(function(){Template.__checkName("help"),Template.help=new Template("Template.help",function(){var e=this;return[HTML.DIV({id:"wrap"},"\n        ",Spacebars.include(e.lookupTemplate("nav")),"\n        ",HTML.Raw('<div class="container-fluid page-with-background"> \n            <div class="row">\n                <div class="content-background"></div>\n                <div class="container main_section content-front">\n                    <h1 class="header1">Help Center</h1>\n                    <div class="header3">Welcome to the new Resume.com, having issues with your account?</div>\n\n                    <div class="row">\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">My password isn\'t working</h4>\n                            <span><p>If you\'re having problems signing into your account, you can always use our Forgot Your Password in the sign in modal.\n    A password update link will be emailed to you right away. Be sure to check your spam or junk folder if you don\'t seem to receive the email.</p></span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">My resume is missing</h4>\n                            <span><p>To manage your resume, please sign in and you\'ll be taken to your Dashboard. You will see a list of any resumes you have made, then you can view, edit, and share your resume link. Click the pencil icon beside your resume to make your edits. Make sure to save your information once you\'ve edited it!</p> </span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">Is Resume.com free?</h4>\n                            <span><p>Our Resume Builder is completely free to use, and once a resume is created, it will be available to its owner online anytime. You can edit it, share your online resume link, and with your free account you can also download a plain text version to your computer.</p>\n                            <p>You always have the choice to upgrade your account to receive premium features such as downloading your resume in Word or PDF format, downloading premium templates, and printing and sharing your resume via email with employers.</p>\n\n                            <p>To access your download options, please sign in to Resume.com. On your Dashboard you will see the icon for the "Download Options" where you can choose your type of download. Or, if you wish, you can subscribe to the Premium Membership at anytime by clicking the blue "Upgrade" button at the top of your screen.</p>\n                            </span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">I want to download my resume</h4>\n                            <span><p>To download your resume, please sign into your account and press the "Download" icon beside the resume you\'d like to download. Choose the type of download you\'d like (the free text download is the last option) and your file will download to wherever you\'ve set up documents to save to your computer.</p> </span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">My PDF doesn\'t fit the page properly</h4>\n                            <span><p>You may experience this if you have chosen a "digital" template for your resume. Digital templates are specially formatted to give your resume a great look online, but they are not meant for printing. If you would like to print a hard copy of your resume, please choose a template other than "digital" and you should have no problems.</p> </span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">I want to add a photo to my profile</h4>\n                            <span><p>To add a photo to your profile, please sign in at https://resume.com. On your profile page you will see the "Profile Picture". Just click that and you can upload your photo! If you choose a template that has a photo space, your picture will automatically be added to that space. </p> </span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">I want to delete my Resume.com account</h4>\n                            <span><p>You can delete your account by contacting our support team.</p> </span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">I\'d like to cancel my Premium Membership subscription</h4>\n                            <span>\n                                <ul>\n                                    <li>Login to your account</li>\n                                    <li>Click the \'Profile\' button from the dropdown menu in the top right</li>\n                                    <li>Click the \'Subscriptions\' tab</li>\n                                    <li>Click the \'Cancel Subscription\' button</li>\n                                </ul>\n                                <p>Your premium features will remain active until the end of your paid period, at which time you will then have access to your basic account. At that time you will no longer be able to print or download your premium resume, access premium templates, or email resumes to employers from the dashboard.</p>\n                            </span>\n                        </div>\n                        <div class="col-md-12 solution">\n                            <h4 class="header3">I upgraded my account, but I don\'t have the premium features</h4>\n                            <span><p>This can happen if your credit card bank doesn\'t authorize the charge. If you\'d like to have access to the premium features, you\'ll need to try the upgrade again. However, we suggest that you contact your credit card bank prior to reattempting the charge to find out why they didn\'t authorize it.</p> </span>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>'),"\n    ",Spacebars.include(e.lookupTemplate("footerLarge")),"\n    "),"\n    ",Blaze.If(function(){return Spacebars.call(e.lookup("currentUser"))},function(){return["\n        ",Blaze._TemplateWith(function(){return{template:Spacebars.call(e.lookup("premium_popup_version"))}},function(){return Spacebars.include(function(){return Spacebars.call(Template.__dynamic)})}),"\n    "]},function(){return["\n        ",Spacebars.include(e.lookupTemplate("loginform"))," \n        ",Spacebars.include(e.lookupTemplate("forgotform")),"\n    "]})]})}).call(this);

